using TelERP.Persistencia;
using System;
using System.Collections.Generic;
using System.Data;
using System.Drawing;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace TelERP.Controlador
{
    class GestorUsers
    {

        string img = "";

        

        MySQL mySQL;

        public GestorUsers()
        {
            mySQL = new MySQL();
        }

        public DataTable mostrarDatos()
        {
            DataTable dat = mySQL.readDataExiste("users");
            DataColumn c = dat.Columns["photo"];
            dat.Columns.Remove(c);
            dat.Columns["iduser"].ColumnName = Strings.HeaderID;
            dat.Columns["nombre"].ColumnName = Strings.HeaderNombre;
            dat.Columns["apellidos"].ColumnName = Strings.HeaderApellidos;
            dat.Columns["email"].ColumnName = Strings.HeaderEmail;
            dat.Columns["telefono"].ColumnName = Strings.HeaderTelefono;
            return dat;
        }

        public DataTable tablaCompleta()
        {
            return mySQL.readData("users");
        }

        public DataRow infoUser(int id)
        {
            return mySQL.readRow("users", "iduser = " + id);
        }

        public string getDeuda(int id)
        {
            return mySQL.singleData("select (select ifnull(sum(precio),0) from assignment where refuser=" + id + " and pagado = 0) + (select ifnull(sum(precio),0) from services s, userservice us where us.refuser=" + id + " and us.refservice = s.idservice)");
        }

        public DataTable usersDeuda()
        {
            return mySQL.readSQLType("select u.iduser " + Strings.HeaderID + ", (u.nombre || ' ' || u.apellidos) " + Strings.HeaderUsuario + ", (select ifnull(sum(precio),0) from assignment where refuser=u.iduser and pagado = 0) " + Strings.HeaderTrabajos + ", (select ifnull(sum(precio),0)*(select count(*) from invoices where pagada=0 and refuser=u.iduser) from services s, userservice us where us.refuser=u.iduser and us.refservice = s.idservice) " + Strings.HeaderServicios + " from users u, invoices i where i.pagada=0 and i.refuser=u.iduser group by u.iduser");
        }

        public DataTable userWithService(int id)
        {
            return mySQL.readSQL("select u.* from users u, userservice us where u.iduser = us.refuser and us.refservice = " + id);
        }

        public byte[] getImage(int id)
        {
            return mySQL.getPhoto(id);
        }

        public void insertarUser(int id, string name, string surname, string email, int phone)
        {
            string sql = "insert into users values("+id+",'"+name+"','"+surname+"','"+email+"',"+phone+",X'"+img+"',0)";
            mySQL.executeQuery(sql);
        }

        public void actualizaUser(int id, string name, string surname, string email, int phone)
        {
            string sql = "update users set nombre = '"+name+"', apellidos = '"+surname+"', email = '"+email+"', telefono = "+phone+", photo = X'"+img+"' where iduser = "+id;
            mySQL.executeQuery(sql);
        }

        public void cambiaFoto(int id, string foto)
        {
            string sql = "update users set photo = X'" + foto + "' where iduser = " + id;
            mySQL.executeQuery(sql);
        }

        public void borrarUser(int id)
        {
            string sql = "update users set deleted = 1 where iduser = " + id;
            mySQL.executeQuery(sql);
        }

        internal void pagarDeuda(int id)
        {
            string sql = "update invoices set pagada = 1 where refuser = " + id;
            mySQL.executeQuery(sql);
            sql = "update assignment set pagado = 1 where refuser = " + id;
            mySQL.executeQuery(sql);
        }

        internal void pagarTrabajos(int id)
        {
            string sql = "update assignment set pagado = 1 where refuser = " + id;
            mySQL.executeQuery(sql);
        }

        public int getLastId()
        {
            int ret = 0;
            string sql = "select max(iduser) from users";
            string consulta = mySQL.singleData(sql);
            if (consulta.Length>0) ret = int.Parse(consulta);
            return ret;
        }
    }
}
